import React from "react";
import { Link } from "react-router-dom";

function Header() {
  return (
    <Header>
      <div className="logo">
        <h1>
          <Link>Isitcom Library</Link>
        </h1>
      </div>
      <ul>
        <li>
          <Link>Cart</Link>
        </li>
        <li></li>
      </ul>
    </Header>
  );
}

export default Header;
